/*import LoginForm from '../Components/Login/LoginForm';*/

const Login = () => {
  return (
    <div style={{width: '100%', height: '100%', position: 'relative', background: '#070707'}}>
    <img style={{width: 828, height: 1024, left: 612, top: 0, position: 'absolute', borderTopLeftRadius: 30, borderTopRightRadius: 30}} src="https://via.placeholder.com/828x1024" />
    <div style={{left: 44, top: 43, position: 'absolute', color: '#FCFCFC', fontSize: 64, fontFamily: 'Roboto', fontWeight: '500', letterSpacing: 3.20, wordWrap: 'break-word'}}>Iniciar sesión</div>
    <div style={{width: 510, height: 87, left: 44, top: 192, position: 'absolute', background: '#302D2D', borderRadius: 5}} />
    <div style={{left: 44, top: 154, position: 'absolute', color: '#FCFCFC', fontSize: 24, fontFamily: 'Roboto', fontWeight: '400', letterSpacing: 1.20, wordWrap: 'break-word'}}>Nombre de usuario o email</div>
    <div style={{left: 45, top: 312, position: 'absolute', color: '#FCFCFC', fontSize: 24, fontFamily: 'Roboto', fontWeight: '400', letterSpacing: 1.20, wordWrap: 'break-word'}}>Contraseña</div>
    <div style={{left: 57, top: 218, position: 'absolute', color: '#C4C4C4', fontSize: 30, fontFamily: 'Roboto', fontWeight: '400', letterSpacing: 1.50, wordWrap: 'break-word'}}>User34</div>
    <div style={{left: 41, top: 615, position: 'absolute', color: '#C4C4C4', fontSize: 24, fontFamily: 'Roboto', fontWeight: '400', letterSpacing: 1.20, wordWrap: 'break-word'}}>¿No estás registrado? </div>
    <div style={{left: 306, top: 615, position: 'absolute', color: '#BD00FF', fontSize: 24, fontFamily: 'Roboto', fontWeight: '400', letterSpacing: 1.20, wordWrap: 'break-word'}}>Crea una cuenta</div>
    <div style={{width: 510, height: 87, left: 44, top: 346, position: 'absolute', background: '#302D2D', borderRadius: 5}} />
    <div style={{width: 501, height: 87, left: 44, top: 507, position: 'absolute'}}>
        <div style={{left: 152, top: 26, position: 'absolute', color: '#C4C4C4', fontSize: 30, fontFamily: 'Roboto', fontWeight: '400', letterSpacing: 1.50, wordWrap: 'break-word'}}>Iniciar sesión</div>
        <div style={{width: 501, height: 87, left: 0, top: 0, position: 'absolute', borderRadius: 5, border: '2px #BD00FF solid'}} />
    </div>
    <div style={{left: 57, top: 379, position: 'absolute', color: '#C4C4C4', fontSize: 30, fontFamily: 'Roboto', fontWeight: '400', letterSpacing: 1.50, wordWrap: 'break-word'}}>********</div>
</div>

  );
};

export default Login;
